column8:
蓄熱性の高い鉄製で、ふっくら焼けます。<br><br>

オムレツ作りにぴったりなサイズ。<br>
鉄鍋ならではの性能で、オムレツ以外の万能鍋としても便利です。<br>
パンケーキはふっくらと、野菜炒めはシャキシャキ美味しく出来上がります。<br><br>

鉄板の表面にはファイバーライン加工を施し、鉄素材の弱点だった、焦げ付き、こびりつきを限りなく抑え、油馴染みも良好。<br>
木柄には水に強いタフなチーク材を使用。<br><br>

長く使える高い耐久性、そして使い込むほど油が良く馴染み使いやすくなる。<br><br>

鉄の魅力を最大限に生かしたフライパンです。
<br><br><br><br>



【サイズ】幅：約24cm、長さ：約39.9cm、<br>
　　　　　高さ：約7.7cm、深さ：約4.4cm<br>
【素材】鉄(ファイバーライン加工)、<br>
　　　　取っ手：ステンレス鋼、チーク材<br>
【デザイン】小泉　誠<br>
【その他】IH使用可◎<br><br><br><br>



